import { useState } from "react";
import { jsPDF } from "jspdf";

const logoBase64 = "data:image/png;base64,"; // Substituir pelo teu logo real

export default function FormularioRececao() {
const [form, setForm] = useState({
  cliente: "",
  tipoInstrumento: "",
  numeroServico: "",
  marca: "",
  modelo: "",
  numeroSerie: "",
  servicoEfetuar: "",
  precoPrevisto: "",
  dataEntrada: "",
});


  const labels = {
  cliente: "Cliente",
  tipoInstrumento: "Tipo de Instrumento",
  numeroServico: "Nmero de Servio",
  marca: "Marca",
  modelo: "Modelo",
  numeroSerie: "Nmero de Srie",
  servicoEfetuar: "Servio a Efetuar",
  precoPrevisto: "Preo Previsto",
  dataEntrada: "Data de Entrada"
};


  const atualizarCampo = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));
  };

  const gerarPDF = () => {
    const doc = new jsPDF();
    doc.setFont("helvetica", "normal");
    doc.setFontSize(12);

    // Logo e info
    doc.addImage(logoBase64, "PNG", 10, 10, 70, 25);
    doc.setFont("helvetica", "normal");
    doc.text("VallisTech".normalize("NFC"), 120, 15);
    doc.text("Rua Fernandes Pegas, n70/80 Loja C".normalize("NFC"), 120, 22);
    doc.text("Valongo, Portugal".normalize("NFC"), 120, 28);
    doc.text("Telefone: 924744133".normalize("NFC"), 120, 34);
    doc.text("Email: geral@vallismusic.com".normalize("NFC"), 120, 40);

    doc.setFontSize(14);
    doc.text("Ficha de Receo de Instrumento".normalize("NFC"), 65, 60);

    let y = 70;
  Object.entries(form).forEach(([campo, valor]) => {
  const label = labels[campo] || campo;
  const texto = `${label}: ${valor}`.normalize("NFC");
  const linhas = doc.splitTextToSize(texto, 180);
  linhas.forEach((linha, i) => {
    doc.text(linha, 20, y + i * 10);
  });
  y += linhas.length * 10;
});

// Espao aps os campos
y += 10;
doc.setFontSize(10);
doc.setFont("helvetica", "italic");
doc.text("Valor dos servios sem IVA includo", 20, y);

    doc.save(`rececao_${form.cliente.replace(/\s+/g, "_")}.pdf`);
    
  };

  return (
    <div style={{ maxWidth: "600px", margin: "auto", padding: "20px" }}>
      <h1>Receo de Instrumento</h1>
      <form onSubmit={(e) => { e.preventDefault(); gerarPDF(); }}>
        {[
  "cliente",
  "tipoInstrumento",
  "numeroServico",
  "marca",
  "modelo",
  "numeroSerie",
  "servicoEfetuar",
  "precoPrevisto",  // <-- novo campo aqui
  "dataEntrada",
].map((name) => (
  <div key={name} style={{ marginBottom: "10px" }}>
    <label>
      {name === "servicoEfetuar"
        ? "Servio a efetuar"
        : name === "precoPrevisto"
        ? "Preo previsto"
        : name.charAt(0).toUpperCase() +
          name.slice(1).replace(/([A-Z])/g, " $1")}
      :
    </label>
    {name === "servicoEfetuar" ? (
      <textarea
        name={name}
        value={form[name]}
        onChange={atualizarCampo}
        rows="3"
        style={{ width: "100%" }}
      />
    ) : (
      <input
        type={name === "dataEntrada" ? "date" : "text"}
        name={name}
        value={form[name]}
        onChange={atualizarCampo}
        style={{ width: "100%" }}
      />
    )}
  </div>
))}
        <button type="submit">Gerar PDF</button>
      </form>
    </div>
  );
}
